import React from "react";
import {Container, Typography, Box, Grid, Paper} from "@material-ui/core";
import {makeStyles, withStyles} from "@material-ui/core/styles";
import SvgIcon from "@material-ui/core/SvgIcon";
import Button from "@material-ui/core/Button";
import {maxWidth} from "@material-ui/system";

const useStyles = makeStyles(theme => ({
    root: {
        flexGrow: 1,
        marginTop: theme.spacing(20),
        marginBottom: theme.spacing(10),
    },
    typographyBody: {
        marginTop: theme.spacing(3),
    },
    socialLogo: {
        marginTop: theme.spacing(3),
    },
    gridFirst: {
        
    }
}));

function Contacts() {
    const classes = useStyles();

    return (
        <div className={classes.root}>
            <Container maxWidth="lg">
                <Grid
                    container
                    justify="flex-start"
                    alignItems="flex-start"
                >
                    <Grid item sm={3}>
                        <img src={require('../images/Logo_2.png')} />
                        <Typography component="div" className={classes.typographyBody}>
                            <Box fontSize="body1.fontSize">
                                This is a blurb about the company sed do eiusmod tempor incididunt ut labore et dolore ex magna aliqua.
                            </Box>
                        </Typography>
                        <Grid
                            container
                            justify="flex-start"
                            alignItems="flex-start"
                            className={classes.socialLogo}
                        >
                            <Grid item sm={3}>
                                <img src={require('../images/facebook.png')} />
                            </Grid>
                            <Grid item sm={3}>
                                <img src={require('../images/twitter.png')} />
                            </Grid>
                            <Grid item sm={3}>
                                <img src={require('../images/instagram.png')} />
                            </Grid>
                            <Grid item sm={3}>
                                <img src={require('../images/youtube.png')} />
                            </Grid>
                        </Grid>
                    </Grid>
                    <Grid item sm={4}>
                        <Typography component="div">
                            <Box fontSize="body1.fontSize" fontWeight="fontWeightBold">
                                EXPLORE LINKS
                            </Box>
                        </Typography>
                    </Grid>
                </Grid>
            </Container>
        </div>
    )
}

export default Contacts;
